j['y']     = [] ;\n        dAdj['name'] = [] ; dAdj['segID'] = [] ; \n        dAdj['node_color']  = []\n        dEdges['xs'] = [] ; dEdges['ys']  = [] ;\n        //dEdges['edge_alpha'] = [] ;\n        for (var i = 0; i &lt; inds.length; i++) {\n        \n            // Add position entries for node graph. Must keep all lists equal in length.\n            xThis = pos[inds[i]][0] ; yThis = pos[inds[i]][1] ;    \n            dTo['x'].push(xThis) ; dTo['y'].push(yThis) ;\n            \n            // Add metadata entries for node table. Must keep all lists equal in length.\n            dTo['name'].push( dFrom['name'][inds[i]] ) ; dTo['segID'].push( dFrom['segID'][inds[i]] )\n            dTo['node_color'].push( dFrom['node_color'][inds[i]] ) ;\n            \n            // Add metadatra entries for node table. Must keep all lists equal in length.            \n            listAdj = dFrom['jsNeighbours'][inds[i]]\n            for (var j = 0; j &lt; listAdj.length; j++) {  \n                if ( !inds.includes(listAdj[j]) ) {\n                    xAdj = pos[listAdj[j]][0] ; yAdj = pos[listAdj[j]][1] ;\n                    dEdges['xs'].push([xThis,xAdj]) ; dEdges['ys'].push([yThis,yAdj]) ;\n                    //dEdges['edge_alpha'].push( )\n                    if( !indsAddedAdj.includes(listAdj[j]) ) {\n                        indsAddedAdj.push( listAdj[j] )\n                        dAdj['x'].push(xAdj) ; dAdj['y'].push(yAdj)\n                        dAdj['name'].push( dFrom['name'][listAdj[j]] ) ; dAdj['segID'].push( dFrom['segID'][listAdj[j]] ) ;\n                        dAdj['node_color'].push( dFrom['node_color'][listAdj[j]] ) ;\n                    }\n\n                }\n            }\n        }\n        \n        //Tell all target sources and widgets to update \n        sTo.change.emit(); sAdj.change.emit();\n        sEdge.change.emit();\n        tTo.change.emit(); tAdj.change.emit();     \n    "},"id":"1526","type":"CustomJS"},{"attributes":{"children":[{"id":"1518" intersect(a1, a2) {\n            const out = a1.filter(x =&gt; a2.indexOf(x) !== -1);\n            return out;\n        }\n        function mean_angle(pos, list, def=0.0) {\n            // Calculate based on mean position vectors, ather than mean angles.\n            // Instead of returning theta from (-pi,pi), return from (0,2pi)\n            var x = 0.0; var y = 0.0;\n            if (list.length == 0) { return def ;}\n            for (var i=0; i &lt; list.length; i++) { x += pos[list[i]][0] ; y+=pos[list[i]][1]; }\n            x/=list.length; y/=list.length;\n            var th = Math.atan2(y, x);\n            if ( th &gt;= 0 ) { return th; } else { return th+6.28319; }            \n        }\n        function sort_by(a, r){\n            var s = []; var o=[];\n            for (var i=0; i&lt;a.length; i++) {s.push([a[i],r[i]]);}\n            // low to high is a-b\n            s.sort(function(a, b) {return a[1]-b[1];});\n            for (var i=0; i&lt;a.length; i++) {o.push(s[i][0]);}\n            return o;\n        }\n        function get_remainder(pos, r) {\n            var o = [];\n            Object.keys(pos).forEach(function(k) {\n                //WHY THE FUCK DOES JAVASCRIPT CAST THIS INTEGER KEY AUTOMATICALLY INTO STRING?\n                var kk=parseInt(k);\n                if (!(plotted.includes(kk))) { o.push(kk) };\n            });\n            return o; \n        }\n        function resolve_indirect_connections( dictRef, arr, ranking, def) {\n            for (var i=0; i&lt;arr.length; i++) {\n                if ( ranking[i] == def) {\n                    nShared = intersect(arr, dictRef[arr[i]]);\n                    for ( var j=0;j&lt;nShared.length;j++) {\n                        if ( ranking[nShared[j]] != def ) { ranking[i] = ranking[nShared[j]] ; break; }\n                    }\n                }\n            }\n            return ranking;\n        }\n        \n        var nCentre = find_index_by_attr( d, attr, sInput.value );\n        if ( isNaN(nCentre) ) { return ; }\n        pos[nCentre] = [0.0, 0.0] ;\n        plotted.push( nCentre ) ;\n        \n        // First-ring neighbours\n         var neigh1 = d['jsNeighOrdered'][nCentre]\n        //var neigh1 = reorder_1st_ring_neighbours( nCentre, d['jsNeighOrdered'] ); \n        var neigh2 = [] ; var ranking = [] ; var tmp2 = [] ;\n        // Set positions and downstream neighbours;\n        newPos = calc_ring_position(1.0**radPower, neigh1.length);\n        for (var i=0; i &lt; neigh1.length; i++) {\n            pos[ neigh1[i] ] = newPos[i] ;\n            plotted.push( neigh1[i] ) ;\n            for (var j=0; j&lt;d['jsNeighOrdered'][neigh1[i]].length; j++ ) {\n                n = d['jsNeighOrdered'][neigh1[i]][j] \n                if ( !(plotted.includes(n))) {\n                    tmp2.push( n ) ;\n                }\n            }\n        }\n        \n        for (var i=0; i&lt;tmp2.length; i++) {\n            if ( !(plotted.includes(tmp2[i])) ) {\n                if (!(neigh2.includes(tmp2[i]))) {\n                    // Check connections to first-ring\n                    var nShared = intersect(neigh1, d['jsNeighOrdered'][tmp2[i]]);\n                    neigh2.push(tmp2[i]);\n                    ranking.push(mean_angle(pos, nShared));\n                }\n            }\n        }\n        neigh2 = sort_by(neigh2, ranking);\n        \n        // = = Second-ring neighbours = =        \n        var neigh3 = [] ; var ranking = [] ; var tmp2 = [] ;\n        // Set positions and neighbours;\n        newPos = calc_ring_position(2.0**radPower, neigh2.length);\n        for (var i=0; i &lt; neigh2.length; i++) {\n            pos[ neigh2[i] ] = newPos[i] ;\n            plotted.push( neigh2[i] ) ;\n            for (var j=0; j&lt;d['jsNeighOrdered'][neigh2[i]].length; j++ ) {\n                n = d['jsNeighOrdered'][neigh2[i]][j] \n                if ( !(plotted.includes(n))) {\n                    tmp2.push( n ) ;\n                }\n            }            \n        }\n\n        for (var i=0; i&lt;tmp2.length; i++) {\n            if ( !(plotted.includes(tmp2[i])) ) {\n                if (!(neigh3.includes(tmp2[i]))) {\n                    // Check connections to first-ring\n                    var nShared = intersect(neigh2, d['jsNeighOrdered'][tmp2[i]]);\n                    neigh3.push(tmp2[i]);\n                    ranking.push(mean_angle(pos, nShared));\n                }\n            }\n        }\n        neigh3 = sort_by(neigh3, ranking);\n        \n        // = = Third-ring neighbours = =\n        // Set positions and neighbours;\n        newPos = calc_ring_position(3.0**radPower, neigh3.length);\n        for (var i=0; i &lt; neigh3.length; i++) {\n            pos[ neigh3[i] ] = newPos[i] ;\n            plotted.push( neigh3[i] ) ;\n        }        \n        \n        // Outermost ring. Need to decide to hide?\n        var neighZ = get_remainder(pos, plotted);\n        for (var i=0; i&lt;neighZ.length; i++) {\n            pos[ neighZ[i] ] = [Number.NaN,Number.NaN] ;\n        }        \n        \n        //ranking = [];\n        //for (var i=0; i&lt;neighZ.length; i++) {\n        //    nShared = intersect(neigh3, d['jsNeighOrdered'][neighZ[i]]);\n        //    ranking.push(mean_angle(pos, nShared, defNone));\n        //}\n        //// Try to resolve indirect connections.\n        //var i=0;\n        //while ( ranking.includes(defNone) &amp;&amp; i&lt;10 ) {\n        //    ranking = resolve_indirect_connections( d['jsNeighOrdered'], neighZ, ranking, defNone);\n        //    i++;\n        //}\n        //neighZ = sort_by(neighZ, ranking);        \n        //newPos = calc_ring_position(6.0**radPower, neighZ.length);\n        //for (var i=0; i&lt;neighZ.length; i++) {\n        //    pos[ neighZ[i] ] = newPos[i] ;\n        //}\n        \n        s1.change.emit();\n        s2.change.emit();\n    "},"id":"1552","type":"CustomJS"},{"attributes":{"label":{"value":"Off state"},"renderers":[{"id":"1683"}]},"id":"1697","type":"Lege  N ) {\n            var out = [];\n            for (var i=0; i&lt;N; i++) { out.push( [r*Math.cos(6.28319*i/N), r*Math.sin(6.28319*i/N)] ) }\n            return out;\n        };\n        function intersect(a1, a2) {\n            const out = a1.filter(x =&gt; a2.indexOf(x) !== -1);\n            return out;\n        }\n        function mean_angle(pos, list, def=0.0) {\n            // Calculate based on mean position vectors, ather than mean angles.\n            // Instead of returning theta from (-pi,pi), return from (0,2pi)\n            var x = 0.0; var y = 0.0;\n            if (list.length == 0) { return def ;}\n            for (var i=0; i &lt; list.length; i++) { x += pos[list[i]][0] ; y+=pos[list[i]][1]; }\n            x/=list.length; y/=list.length;\n            var th = Math.atan2(y, x);\n            if ( th &gt;= 0 ) { return th; } else { return th+6.28319; }            \n        }\n        function sort_by(a, r){\n            var s = []; var o=[];\n            for (var i=0; i&lt;a.length; i++) {s.push([a[i],r[i]]);}\n            // low to high is a-b\n            s.sort(function(a, b) {return a[1]-b[1];});\n            for (var i=0; i&lt;a.length; i++) {o.push(s[i][0]);}\n            return o;\n        }\n        function get_remainder(pos, r) {\n            var o = [];\n            Object.keys(pos).forEach(function(k) {\n                //WHY THE FUCK DOES JAVASCRIPT CAST THIS INTEGER KEY AUTOMATICALLY INTO STRING?\n                var kk=parseInt(k);\n                if (!(plotted.includes(kk))) { o.push(kk) };\n            });\n            return o; \n        }\n        function resolve_indirect_connections( dictRef, arr, ranking, def) {\n            for (var i=0; i&lt;arr.length; i++) {\n                if ( ranking[i] == def) {\n                    nShared = intersect(arr, dictRef[arr[i]]);\n                    for ( var j=0;j&lt;nShared.length;j++) {\n                        if ( ranking[nShared[j]] != def ) { ranking[i] = ranking[nShared[j]] ; break; }\n                    }\n                }\n            }\n            return ranking;\n        }\n        \n        var nCentre = find_index_by_attr( d, attr, sInput.value );\n        if ( isNaN(nCentre) ) { return ; }\n        pos[nCentre] = [0.0, 0.0] ;\n        plotted.push( nCentre ) ;\n        \n        // First-ring neighbours\n         var neigh1 = d['jsNeighOrdered'][nCentre]\n        //var neigh1 = reorder_1st_ring_neighbours( nCentre, d['jsNeighOrdered'] ); \n        var neigh2 = [] ; var ranking = [] ; var tmp2 = [] ;\n        // Set positions and downstream neighbours;\n        newPos = calc_ring_position(1.0**radPower, neigh1.length);\n        for (var i=0; i &lt; neigh1.length; i++) {\n            pos[ neigh1[i] ] = newPos[i] ;\n            plotted.push( neigh1[i] ) ;\n            for (var j=0; j&lt;d['jsNeighOrdered'][neigh1[i]].length; j++ ) {\n                n = d['jsNeighOrdered'][neigh1[i]][j] \n                if ( !(plotted.includes(n))) {\n                    tmp2.push( n ) ;\n                }\n            }\n        }\n        \n        for (var i=0; i&lt;tmp2.length; i++) {\n            if ( !(plotted.includes(tmp2[i])) ) {\n                if (!(neigh2.includes(tmp2[i]))) {\n                    // Check connections to first-ring\n                    var nShared = intersect(neigh1, d['jsNeighOrdered'][tmp2[i]]);\n                    neigh2.push(tmp2[i]);\n                    ranking.push(mean_angle(pos, nShared));\n                }\n            }\n        }\n        neigh2 = sort_by(neigh2, ranking);\n        \n        // = = Second-ring neighbours = =        \n        var neigh3 = [] ; var ranking = [] ; var tmp2 = [] ;\n        // Set positions and neighbours;\n        newPos = calc_ring_position(2.0**radPower, neigh2.length);\n        for (var i=0; i &lt; neigh2.length; i++) {\n            pos[ neigh2[i] ] = newPos[i] ;\n            plotted.push( neigh2[i] ) ;\n            for (var j=0; j&lt;d['jsNeighOrdered'][neigh2[i]].length; j++ ) {\n                n = d['jsNeighOrdered'][neigh2[i]][j] \n                if ( !(plotted.includes(n))) {\n                    tmp2.push( n ) ;\n                }\n            }            \n        }\n\n        for (var i=0; i&lt;tmp2.length; i++) {\n            if ( !(plotted.includes(tmp2[i])) ) {\n                if (!(neigh3.includes(tmp2[i]))) {\n                    // Check connections to first-ring\n                    var nShared = intersect(neigh2, d['jsNeighOrdered'][tmp2[i]]);\n                    neigh3.push(tmp2[i]);\n                    ranking.push(mean_angle(pos, nShared));\n                }\n            }\n        }\n        neigh3 = sort_by(neigh3, ranking);\n        \n        // = = Third-ring neighbours = =\n        // Set positions and neighbours;\n        newPos = calc_ring_position(3.0**radPower, neigh3.length);\n        for (var i=0; i &lt; neigh3.length; i++) {\n            pos[ neigh3[i] ] = newPos[i] ;\n            plotted.push( neigh3[i] ) ;\n        }        \n        \n        // Outermost ring. Need to decide to hide?\n        var neighZ = get_remainder(pos, plotted);\n        for (var i=0; i&lt;neighZ.length; i++) {\n            pos[ neighZ[i] ] = [Number.NaN,Number.NaN] ;\n        }        \n        \n        //ranking = [];\n        //for (var i=0; i&lt;neighZ.length; i++) {\n        //    nShared = intersect(neigh3, d['jsNeighOrdered'][neighZ[i]]);\n        //    ranking.push(mean_angle(pos, nShared, defNone));\n        //}\n        //// Try to resolve indirect connections.\n        //var i=0;\n        //while ( ranking.includes(defNone) &amp;&amp; i&lt;10 ) {\n        //    ranking = resolve_indirect_connections( d['jsNeighOrdered'], neighZ, ranking, defNone);\n        //    i++;\n        //}\n        //neighZ = sort_by(neighZ, ranking);        \n        //newPos = calc_ring_position(6.0**radPower, neighZ.length);\n        //for (var i=0; i&lt;neighZ.length; i++) {\n        //    pos[ neighZ[i] ] = newPos[i] ;\n        //}\n
